import React from 'react';
import { Link } from 'react-router-dom'

function Navigation() {
  return (
    <nav className="Navigation">
      <h3>Ready Roofer</h3>
      <ul className="Nav-Links">
          <Link>
            <li>Get A Quote</li>
          </Link>

          <li>About</li>
      </ul>
    </nav>
  );
}

export default Navigation;
